import { useState } from 'react';
import { importParticipantsFile } from '../services/api';

export default function ImportPage() {
  const [file, setFile] = useState(null);
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');

  const onUpload = async (e) => {
    e.preventDefault();
    setError('');
    setResult(null);
    if (!file) return;
    try {
      const { data } = await importParticipantsFile(file, true);
      setResult(data);
    } catch (err) {
      setError(err?.response?.data?.error || 'Import failed');
    }
  };

  return (
    <div>
      <h2>Import Participants</h2>
      <form onSubmit={onUpload}>
        <input type="file" accept=".csv,.xlsx,.xls" onChange={(e) => setFile(e.target.files?.[0] || null)} />
        <button type="submit" disabled={!file}>Dry Run</button>
      </form>
      {error && <div style={{ color: 'red', marginTop: 12 }}>{error}</div>}
      {result && <pre style={{ marginTop: 12 }}>{JSON.stringify(result, null, 2)}</pre>}
    </div>
  );
}
